description:
Category	Feature, Blu-ray

Starring	Dakota Skye, Derrick Pierce, Eva Karera, Tommy Pistol, Ryan McLane, Jessy Jones, Veronica Rodriguez, Lucy Tyler, Katerina Kay, Giovanni Francisco, Ike Diezel

Embark on a journey with five strikingly beautiful girls, Baby, Dolly, Lee, Angel and Britt, who have the ability to enter a dreamlike reality. Instead of being treated for their illness, the girls are held captive in a hospital and forced to dance for high-end clients. Not keen on misusing their talents, the girls decide to capitalize on their remarkable feminine assets and martial art skills to seduce their boss and clients into a wild ride they won't forget!

